import React, { Component } from 'react';
import './App.css';
import {Button} from 'semantic-ui-react'



function App() {
  return (
    <div className="App">
       <Button>Click Here</Button>
       <Button primary>Primary</Button>
    <Button secondary>Secondary</Button>
    </div>
  );
}

export default App;
